import React, { Component } from "react";
import { Grid, Row, Col, Alert } from "react-bootstrap";
import CustomCheckbox from "components/CustomCheckbox/CustomCheckbox";
import * as typeformEmbed from '@typeform/embed';

class ToDos extends Component {
  componentDidMount() {
    const belongingSurvey = typeformEmbed.makePopup(
      'https://udishab.typeform.com/to/kyXsKDLO',
      {
        mode: 'popup',
        autoClose: 3000,
        hideHeaders: true,
        hideFooter: true,
        onSubmit: () => console.log('Successfully submited')
      })

    document.getElementById('1').addEventListener('click', function () {
      belongingSurvey.open();
    })
  }
  render() {
    return (
      <div className="content">
        <Grid fluid>
          <div className="card">
            <div className="header">
              <h4 className="title">Tasks</h4>
            </div>
            <div className="content">
              <Row>
                <Col md={12}>
                  <CustomCheckbox number={1} label="Complete Profile Setup" />
                  <CustomCheckbox number={2} label="Monthly Sentiment Survey" />
                  <CustomCheckbox number={3} label="Implicit Bias Test 1" />
                  <CustomCheckbox number={4} label="Implicit Bias Test 2" />
                </Col>
              </Row>
            </div>
          </div>
        </Grid>
      </div>
    );
  }
}

export default ToDos;
